import axios from 'axios';
import { apiBaseUrl } from '../contants/constants';

const addCourseApi = async () => {
  try {
    const result = await axios.post(`${apiBaseUrl}/course/create`);
    if (result) {
      return result;
    }
  } catch (err) {
    return { data: err.response.data };
  }
};
export { addCourseApi };
